import classes from './OrderForm.module.css';

const OrderForm = () => {
    return( 
        <form>
            <div>
                <label htmlFor="name">Name</label>
                <input type="text" id="name" />
            </div>
            <div>
                <label htmlFor="address">Address</label>
                <textarea id="address" />
            </div>
        </form>
    )
}

export default OrderForm;
